e\";s:11:\"description\";s:194:\"The text to display in the title bar of a visitor\'s web browser when they view this page. This meta tag may also be used as the title of the page when a visitor bookmarks or favorites this page.\";s:5:\"class\";s:18:\"DrupalTitleMetaTag\";s:5:\"group\";s:5:\"basic\";s:6:\"weight\";i:1;s:4:\"name\";s:5:\"title\";}s:11:\"description\";a:7:{s:5:\"label\";s:11:\"Description\";s:11:\"description\";s:195:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The description meta tag may be used by search engines to display a snippet about the page in search results.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:5:\"basic\";s:6:\"weight\";i:2;s:4:\"form\";a:3:{s:5:\"#type\";s:8:\"textarea\";s:5:\"#rows\";i:2;s:8:\"#wysiwyg\";b:0;}s:4:\"name\";s:11:\"description\";}s:8:\"abstract\";a:7:{s:5:\"label\";s:8:\"Abstract\";s:11:\"description\";s:161:\"A brief and concise summary of the page\'s content, preferably 150 characters or less. The abstract meta tag may be used by search engines for archiving purposes.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:5:\"basic\";s:6:\"weight\";i:3;s:4:\"form\";a:3:{s:5:\"#type\";s:8:\"textarea\";s:5:\"#rows\";i:2;s:8:\"#wysiwyg\";b:0;}s:4:\"name\";s:8:\"abstract\";}s:8:\"keywords\";a:6:{s:5:\"label\";s:8:\"Keywords\";s:11:\"description\";s:122:\"A comma-separated list of keywords about the page. This meta tag is <em>not</em> supported by most search engines anymore.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:5:\"basic\";s:6:\"weight\";i:4;s:4:\"name\";s:8:\"keywords\";}s:6:\"robots\";a:7:{s:5:\"label\";s:6:\"Robots\";s:11:\"description\";s:90:\"Provides search engines with specific directions for what to do when this page is indexed.\";s:5:\"class\";s:17:\"DrupalListMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:5;s:4:\"form\";a:1:{s:8:\"#options\";a:10:{s:5:\"index\";s:50:\"Allow search engines to index this page (assumed).\";s:6:\"follow\";s:60:\"Allow search engines to follow links on this page (assumed).\";s:7:\"noindex\";s:48:\"Prevents search engines from indexing this page.\";s:8:\"nofollow\";s:58:\"Prevents search engines from following links on this page.\";s:9:\"noarchive\";s:69:\"Prevents cached copies of this page from appearing in search results.\";s:9:\"nosnippet\";s:82:\"Prevents descriptions from appearing in search results, and prevents page caching.\";s:5:\"noodp\";s:114:\"Blocks the <a href=\"http://www.dmoz.org/\">Open Directory Project</a> description from appearing in search results.\";s:6:\"noydir\";s:99:\"Prevents Yahoo! from listing this page in the <a href=\"http://dir.yahoo.com/\">Yahoo! Directory</a>.\";s:12:\"noimageindex\";s:57:\"Prevent search engines from indexing images on this page.\";s:11:\"notranslate\";s:78:\"Prevent search engines from offering to translate this page in search results.\";}}s:4:\"name\";s:6:\"robots\";}s:13:\"news_keywords\";a:6:{s:5:\"label\";s:20:\"Google News Keywords\";s:11:\"description\";s:196:\"A comma-separated list of keywords about the page. This meta tag is used as an indicator in <a href=\"http://support.google.com/news/publisher/bin/answer.py?hl=en&amp;answer=68297\">Google News</a>.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:6;s:4:\"name\";s:13:\"news_keywords\";}s:8:\"standout\";a:6:{s:5:\"label\";s:15:\"Google Standout\";s:11:\"description\";s:282:\"Highlight standout journalism on the web, especially for breaking news; used as an indicator in <a href=\"https://support.google.com/news/publisher/answer/191283?hl=en&amp;ref_topic=2484650\">Google News</a>. Warning: Don\'t abuse it, to be used a maximum of 7 times per calendar week!\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:7;s:4:\"name\";s:8:\"standout\";}s:6:\"rating\";a:8:{s:5:\"label\";s:14:\"Content rating\";s:11:\"description\";s:55:\"Used to indicate the intended audience for the content.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:15:\"select_or_other\";b:1;s:4:\"form\";a:3:{s:5:\"#type\";s:6:\"select\";s:8:\"#options\";a:5:{s:7:\"general\";s:7:\"General\";s:6:\"mature\";s:6:\"Mature\";s:10:\"restricted\";s:10:\"Restricted\";s:8:\"14 years\";s:17:\"14 years or Older\";s:13:\"safe for kids\";s:13:\"Safe for kids\";}s:13:\"#empty_option\";s:8:\"- None -\";}s:6:\"weight\";i:8;s:4:\"name\";s:6:\"rating\";}s:8:\"referrer\";a:8:{s:5:\"label\";s:15:\"Referrer policy\";s:11:\"description\";s:207:\"Indicate to search engines and other page scrapers whether or not links should be followed. See <a href=\"http://w3c.github.io/webappsec/specs/referrer-policy/\">the W3C specifications</a> for further details.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:15:\"select_or_other\";b:1;s:4:\"form\";a:3:{s:5:\"#type\";s:6:\"select\";s:8:\"#options\";a:5:{s:11:\"no-referrer\";s:11:\"No Referrer\";s:6:\"origin\";s:6:\"Origin\";s:26:\"no-referrer-when-downgrade\";s:26:\"No Referrer When Downgrade\";s:24:\"origin-when-cross-origin\";s:24:\"Origin When Cross-Origin\";s:10:\"unsafe-url\";s:10:\"Unsafe URL\";}s:13:\"#empty_option\";s:8:\"- None -\";}s:6:\"weight\";i:9;s:4:\"name\";s:8:\"referrer\";}s:9:\"generator\";a:8:{s:5:\"label\";s:9:\"Generator\";s:11:\"description\";s:97:\"Describes the name and version number of the software or publishing tool used to create the page.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"header\";s:11:\"X-Generator\";s:7:\"context\";a:1:{i:0;s:6:\"global\";}s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:10;s:4:\"name\";s:9:\"generator\";}s:6:\"rights\";a:7:{s:5:\"label\";s:6:\"Rights\";s:11:\"description\";s:145:\"Details about intellectual property, such as copyright or trademarks; does not automatically protect the site\'s content or intellectual property.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:11;s:8:\"replaces\";a:1:{i:0;s:9:\"copyright\";}s:4:\"name\";s:6:\"rights\";}s:9:\"image_src\";a:8:{s:5:\"label\";s:5:\"Image\";s:11:\"description\";s:97:\"An image associated with this page, for use as a thumbnail in social networks and other services.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:12;s:5:\"image\";b:1;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:5:\"image\";}s:4:\"name\";s:9:\"image_src\";}s:9:\"canonical\";a:7:{s:5:\"label\";s:13:\"Canonical URL\";s:11:\"description\";s:86:\"Preferred page location or URL to help eliminate duplicate content for search engines.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:13;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:9:\"canonical\";}s:4:\"name\";s:9:\"canonical\";}s:9:\"shortlink\";a:8:{s:5:\"label\";s:13:\"Shortlink URL\";s:11:\"description\";s:55:\"A brief URL, often created by a URL shortening service.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:14;s:8:\"replaces\";a:1:{i:0;s:8:\"shorturl\";}s:14:\"devel_generate\";a:1:{s:4:\"type\";s:9:\"shortlink\";}s:4:\"name\";s:9:\"shortlink\";}s:9:\"publisher\";a:7:{s:5:\"label\";s:13:\"Publisher URL\";s:11:\"description\";s:0:\"\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:15;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:9:\"publisher\";}s:6:\"author\";a:7:{s:5:\"label\";s:10:\"Author URL\";s:11:\"description\";s:194:\"Used by some search engines to confirm authorship of the content on a page. Should be either the full URL for the author\'s Google+ profile page or a local page with information about the author.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:16;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:6:\"author\";}s:15:\"original-source\";a:7:{s:5:\"label\";s:15:\"Original Source\";s:11:\"description\";s:200:\"Used to indicate the URL that broke the story, and can link to either an internal URL or an external source. If the full URL is not known it is acceptable to use a partial URL or just the domain name.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:17;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:15:\"original-source\";}s:4:\"prev\";a:7:{s:5:\"label\";s:17:\"Previous page URL\";s:11:\"description\";s:191:\"Used for paginated content. Meet Google recommendations to <a href=\"https://support.google.com/webmasters/answer/1663744\">indicate paginated content</a> by providing URL with rel=\"prev\" link.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:18;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:4:\"prev\";}s:4:\"next\";a:7:{s:5:\"label\";s:13:\"Next page URL\";s:11:\"description\";s:191:\"Used for paginated content. Meet Google recommendations to <a href=\"https://support.google.com/webmasters/answer/1663744\">indicate paginated content</a> by providing URL with rel=\"next\" link.\";s:5:\"class\";s:17:\"DrupalLinkMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:19;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:3:\"url\";}s:4:\"name\";s:4:\"next\";}s:16:\"content-language\";a:7:{s:5:\"label\";s:16:\"Content language\";s:11:\"description\";s:75:\"A deprecated meta tag for defining this page\'s two-letter language code(s).\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:20;s:7:\"element\";a:1:{s:6:\"#theme\";s:18:\"metatag_http_equiv\";}s:4:\"name\";s:16:\"content-language\";}s:12:\"geo.position\";a:6:{s:5:\"label\";s:12:\"Geo position\";s:11:\"description\";s:176:\"Geo-spatial information in \"latitude;longitude\" format, e.g. \"50.167958;-97.133185\"; <a href=\"http://en.wikipedia.org/wiki/Geotagging#HTML_pages\">see Wikipedia for details</a>.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:21;s:4:\"name\";s:12:\"geo.position\";}s:13:\"geo.placename\";a:6:{s:5:\"label\";s:14:\"Geo place name\";s:11:\"description\";s:25:\"A location\'s formal name.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:22;s:4:\"name\";s:13:\"geo.placename\";}s:10:\"geo.region\";a:6:{s:5:\"label\";s:10:\"Geo region\";s:11:\"description\";s:130:\"A location\'s two-letter international country code, with an optional two-letter region, e.g. \"US-NH\" for New Hampshire in the USA.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:23;s:4:\"name\";s:10:\"geo.region\";}s:4:\"icbm\";a:6:{s:5:\"label\";s:4:\"ICBM\";s:11:\"description\";s:161:\"Geo-spatial information in \"latitude, longitude\" format, e.g. \"50.167958, -97.133185\"; <a href=\"http://en.wikipedia.org/wiki/ICBM\">see Wikipedia for details</a>.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:24;s:4:\"name\";s:4:\"icbm\";}s:7:\"refresh\";a:7:{s:5:\"label\";s:7:\"Refresh\";s:11:\"description\";s:189:\"The number of seconds to wait before refreshing the page. May also force redirect to another page using the format \"5; url=http://example.com/\", which would be triggered after five seconds.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:25;s:7:\"element\";a:1:{s:6:\"#theme\";s:18:\"metatag_http_equiv\";}s:4:\"name\";s:7:\"refresh\";}s:13:\"revisit-after\";a:7:{s:5:\"label\";s:13:\"Revisit After\";s:11:\"description\";s:193:\"Tell search engines when to index the page again. Very few search engines support this tag, it is more useful to use an <a href=\"https://www.drupal.org/project/xmlsitemap\">XML Sitemap</a> file.\";s:5:\"class\";s:25:\"DrupalDateIntervalMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:26;s:14:\"devel_generate\";a:1:{s:4:\"type\";s:4:\"date\";}s:4:\"name\";s:13:\"revisit-after\";}s:6:\"pragma\";a:7:{s:5:\"label\";s:6:\"Pragma\";s:11:\"description\";s:147:\"Used to control whether a browser caches a specific page locally. Little used today. Should be used in conjunction with the Cache-Control meta tag.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:27;s:7:\"element\";a:1:{s:6:\"#theme\";s:18:\"metatag_http_equiv\";}s:4:\"name\";s:6:\"pragma\";}s:13:\"cache-control\";a:7:{s:5:\"label\";s:13:\"Cache-Control\";s:11:\"description\";s:140:\"Used to control whether a browser caches a specific page locally. Little used today. Should be used in conjunction with the Pragma meta tag.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:28;s:7:\"element\";a:1:{s:6:\"#theme\";s:18:\"metatag_http_equiv\";}s:4:\"name\";s:13:\"cache-control\";}s:7:\"expires\";a:7:{s:5:\"label\";s:7:\"Expires\";s:11:\"description\";s:330:\"Control when the browser\'s internal cache of the current page should expire. The date must to be an <a href=\"http://www.csgnetwork.com/timerfc1123calc.html\">RFC-1123</a>-compliant date string that is represented in Greenwich Mean Time (GMT), e.g. \'Wed, 06 Apr 2016 22:41:19 GMT\'. Set to \'0\' to stop the page being cached entirely.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:6:\"weight\";i:29;s:5:\"group\";s:8:\"advanced\";s:14:\"devel_generate\";a:1:{s:4:\"type\";s:4:\"date\";}s:4:\"name\";s:7:\"expires\";}}}',0,1459982478,1);
